import React from 'react';
import styled from 'styled-components';

function App() {
  const Wrapper = styled.div`
  background: rgb(0,8,88);
background: linear-gradient(180deg, rgba(0,8,88,1) 0%, rgba(0,16,94,1) 79%, rgba(22,57,149,1) 100%);

  `

  return (
    <div className="App">

    </div>
  );
}

export default App;
